"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt;\">Все претензии, касающиеся комплектности, технического состояния автомобиля, объёма и качества выполненных работ, исправности узлов и агрегатов, подвергшихся ремонту или подмены отдельных составных частей автомобиля, Заказчик обязан предъявить Исполнителю непосредственно при получении автомобиля , после проведения технического обслуживания или/ и ремонта автомобиля. В противном случае Заказчик теряет право впоследствии ссылаться на наличие каких-либо недостатков (дефектов ) в выполненной Исполнителем работе ( оказанных услугах ), предоставленных Исполнителем запасных частях и/или расходных материалах, либо на нарушение комплектности и технического состояния автомобиля.</span><span style=\" font-size:8pt;\"> </span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt;\">        При обнаружении Заказчиком недостатков в выполненной работе, они устраняются Исполнителем в течении 45 рабочих</span><span style=\" font-size:8pt;\"> </span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt;\">Дней с момента получения соответствующего требования Заказчика. В том случае, если устранение обнаруженных Заказчиком недостатков требует заказа необходимых комплектующих у организации- производителя ( поставщика ), срок устранения выявленных недостатков увеличивается соразмерно времени, необходимого для получения Исполнителем заказанных комплектующих.</span><span style=\" font-size:8pt;\"> </span></p>\n"
